import React from 'react';
import { AppProps } from 'next/app';
import Head from 'next/head';

const App = ({ Component, pageProps }: AppProps) => {
  return (
    <>
      <Head>
        <meta charSet='utf-8' />
        <title>hey</title>
      </Head>
      <Component {...pageProps} />
    </>
  );
};

export default App;
